import React from "react";
import gitimg from '../assets/github.png'
const ContactMe = () =>
{
    return(
        <div className="contactme">
            <div className="heading">
                <h2>C O N T A C T   M E </h2>
            </div>
            <div>
                <img src={gitimg}/>
            </div>
        </div>
    )
}
export default ContactMe;
